package pers.juumii.service.impl.serializer;

import org.junit.jupiter.api.Test;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.test.context.SpringBootTest;
import pers.juumii.data.Resource;

import java.time.LocalDateTime;
import java.util.HashMap;
import java.util.Map;

@SpringBootTest
class QuizcardSerializerTest {

    private final QuizcardSerializer serializer;

    @Autowired
    QuizcardSerializerTest(QuizcardSerializer serializer) {
        this.serializer = serializer;
    }

    @Test
    void serialize(){

        Resource meta = new Resource();
        meta.setId(12345L);
        meta.setCreateBy(10086L);
        meta.setCreateTime(LocalDateTime.now());
        meta.setType(QuizcardSerializer.class.getSimpleName());

        Map<String, Object> data = new HashMap<>();
        data.put("front", "This is FRONT");
        data.put("back", "This is BACK");
        Map<String, String> imgs = new HashMap<>();
        imgs.put("test.png", "data:image/png;base64,");
        data.put("imgs", imgs);

        serializer.serialize(meta, data);
    }

}